package se.inera.certificate.modules.rli.model.external.common;

public class Omfattning {

	private Integer antalBehandlingstillfallen;
	private Integer antalGangerPerVecka;
	private Integer antalGangerPerDag;

	public Integer getAntalBehandlingstillfallen() {
		return antalBehandlingstillfallen;
	}

	public void setAntalBehandlingstillfallen(Integer antalBehandlingstillfallen) {
		this.antalBehandlingstillfallen = antalBehandlingstillfallen;
	}

	public Integer getAntalGangerPerVecka() {
		return antalGangerPerVecka;
	}

	public void setAntalGangerPerVecka(Integer antalGangerPerVecka) {
		this.antalGangerPerVecka = antalGangerPerVecka;
	}

	public Integer getAntalGangerPerDag() {
		return antalGangerPerDag;
	}

	public void setAntalGangerPerDag(Integer antalGangerPerDag) {
		this.antalGangerPerDag = antalGangerPerDag;
	}
}
